package com.example.funwatsapp;

import androidx.appcompat.app.AppCompatActivity;
import android.os.Bundle;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.appcompat.widget.Toolbar;
import com.example.funwatsapp.databinding.ActivityMainBinding;
import java.util.Arrays;
import java.util.HashMap;
import java.util.List;

public class MainActivity extends AppCompatActivity {

    private ActivityMainBinding binding;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        binding = ActivityMainBinding.inflate(getLayoutInflater());
        setContentView(binding.getRoot());

        Toolbar toolbar = binding.toolbar;
        setSupportActionBar(toolbar);


        List<String> contacts = Arrays.asList("Бабушка", "Дедушка", "Мама", "Папа", "Братишка", "Сестренка");

        HashMap<String, String> contactImages = new HashMap<>();
        contactImages.put("Бабушка", "data:image/jpeg;base64,");
        contactImages.put("Дедушка", "data:image/jpeg;base64,");
        contactImages.put("Мама", "data:image/jpeg;base64,");
        contactImages.put("Папа", "data:image/jpeg;base64,");
        contactImages.put("Братишка", "data:image/jpeg;base64,");
        contactImages.put("Сестренка", "data:image/jpeg;base64,");

        ContactsAdapter adapter = new ContactsAdapter(this, contacts, contactImages);
        binding.recyclerView.setLayoutManager(new LinearLayoutManager(this));
        binding.recyclerView.setAdapter(adapter);
    }
}

